import React, {useState, useEffect} from 'react'
import {useHistory, Link, useParams} from "react-router-dom"
import WorkspaceCard from '../Components/Self-Workspace-Card'
import workspacesAPI from '../API/workspaces'

const AccountWorkspaces = () => {
    const [workspaces, setWorkspaces] = useState();
    const [loaded, setLoaded] = useState(false);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const workspaces = await workspacesAPI.get("/");

                setWorkspaces(workspaces.data.data);
                setLoaded(true);
            } catch (err) {}
        }
        fetchData();
    }, [])

    return (
        <>
            {loaded &&
                <div className="width-body">  
                    <div className="home-top">
                        <h1>My Workspaces</h1>
                        <Link to="/new-workspace" className="home-new-workspace">New Workspace</Link>
                    </div>
                    <div className="home-workspaces">
                        {workspaces.map((workspace, i) => {
                            return <WorkspaceCard workspace={workspace} key={i} />
                        })}
                    </div>
                </div>
            }
        </>
    )
}

export default AccountWorkspaces
